      string: '{"uuid":"http://hdl.handle.net/2451/34082","dc_identifier_s":"http://hdl.handle.net/2451/34082","dc_title_s":"2010
        U.S. Core Based Statistical Areas","dc_description_s":" U.S. Core Based Statistical
        Areas represents geographic entities, defined by the United States Office
        of Management and Budget for use by Federal statistical agencies, based on
        the concept of a core area with a large population nucleus, plus adjacent
        communities having a high degree of economic and social integration with that
        core. A Core-Based Statistical Area (CBSA) consists of a U.S. county or counties
        or equivalent entities associated with at least one core (urbanized area or
        urban cluster) with a population of at least 10,000 along with any adjacent
        counties having a high degree of social and economic integration with the
        core as measured through commuting ties with the counties containing the core.
        CBSAs are categorized as being either Metropolitan or Micropolitan. Each Metropolitan
        Statistical Area must have at least one urbanized area of 50,000 or more inhabitants.
        Each Micropolitan Statistical Area must have at least one urban cluster of
        at least 10,000 but less than 50,000 population.","dc_rights_s":"Restricted","dct_provenance_s":"NYU","dct_references_s":"{\"http://schema.org/url\":\"http://hdl.handle.net/2451/34082\",\"http://schema.org/downloadUrl\":\"https://archive.nyu.edu/bitstream/2451/34082/2/nyu-2010USCoreBasedStatisticalAreas.zip\",\"http://www.opengis.net/def/serviceType/ogc/wfs\":\"http://maps-restricted.nyusdr.net/geoserver/nyu_sdr/wfs\",\"http://www.opengis.net/def/serviceType/ogc/wms\":\"http://maps-restricted.nyusdr.net/geoserver/nyu_sdr/wms\"}","layer_id_s":"nyu_sdr:nyu-2010uscorebasedstatisticalareas","layer_slug_s":"nyu-2010USCoreBasedStatisticalAreas","layer_geom_type_s":"Polygon","layer_modified_dt":"2015-8-10T15:58:7Z","dc_format_s":"Shapefile","dc_language_s":"eng","dc_type_s":"Dataset","dc_publisher_s":"Environmental
